con:mockOperation.con:dispatchPath:
import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.support.wsdl.WsdlContext
import com.eviware.soapui.impl.wsdl.support.wsdl.WsdlValidator
import com.eviware.soapui.impl.wsdl.panels.mockoperation.WsdlMockRequestMessageExchange

def mockService = mockOperation.mockService

def wsdlcontext = new WsdlContext("http://localhost:${mockService.port}/${mockService.path}?WSDL");
def validator = new WsdlValidator(wsdlcontext);
def msgExchange = new WsdlMockRequestMessageExchange(mockRequest, mockOperation); 
def errors = validator.assertRequest(msgExchange, false);

def msg = ""
if (errors.length > 0) {
	errors.each {
		log.error("Incoming request contains error ${it.toString()}")
		msg += "${it.toString()}\n"
	}
	context.validationMessages = msg
	return "SoapFault"
}

def holder = new XmlHolder( mockRequest.requestContent )
serviceDomain = 'urn:riv:clinicalprocess:activityprescription:actoutcome'
contractVersion = '2'
domainVersion = '2'
holder.namespaces['soapenv'] = 'http://schemas.xmlsoap.org/soap/envelope/'
holder.namespaces['urn'] = 'urn:riv:itintegration:registry:1'
holder.namespaces['urn1'] = serviceDomain + ':GetMedicationHistoryResponder:' + contractVersion
holder.namespaces['urn2'] = serviceDomain + ':' + domainVersion

def requestRoot = '/soapenv:Envelope/soapenv:Body/urn1:GetMedicationHistory/'
def careUnitHSAId = holder.getNodeValue(requestRoot + 'urn1:careUnitHSAId')
def patientId = holder.getNodeValue(requestRoot + 'urn1:patientId/urn2:id')
def patientIdType = holder.getNodeValue(requestRoot + 'urn1:patientId/urn2:type')
def sourceSystemHSAId = holder.getNodeValue(requestRoot + 'urn1:sourceSystemHSAId')
def careContactId = holder.getNodeValue(requestRoot + 'urn1:careContactId')
context.patientId = patientId
context.patientIdType = patientIdType
context.careUnitHSAId = careUnitHSAId
context.sourceSystemHSAId = sourceSystemHSAId
context.careContactId = careContactId


def responseName = mockRequest.requestHeaders['x-mock-response'][0]
log.debug("responseName: ${responseName}")

return responseName
